import React from "react";

import TableColumn from "./datatable.js";

function DataTable({ columnID, data }) {
  return (
    <div className="data-table">
      {data == null
        ? "Loading..."
        : data.map((columnID) => (
            <TableColumn columnID={columnID} column={column[columnID]} />
          ))}
    </div>
  );
}

export default DataTable;
